import React from 'react';
import './styleNavMenu.css';

const navMenu = () => (
    <nav className='navMenu'>
        <ul className='container'>
            <li className='item'>Home</li>
            <li>About</li>
            <li>Contact</li>
        </ul>
    </nav>    
)

export default navMenu;
